import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import {  Presence } from 'src/app/models/presencemodel';
import { PresenceService } from 'src/app/core/services/presence.service';
import { EmployeeService } from 'src/app/core/services/employee.service';


@Component({
  selector: 'app-presence-list',
  templateUrl: './presence-list.component.html',
  styleUrls: ['./presence-list.component.css']
})
export class PresenceListComponent implements OnInit{

  presences: any[] = [];
  employees: any[] = [];



  constructor(
    private presenceService: PresenceService,
    private employeeService: EmployeeService,
    private router: Router
  ) {}

  ngOnInit(): void {
    this.loadEmployees();
    this.loadPresences();
  }

loadEmployees() {
  this.employeeService.getAllEmployees().subscribe({
    next: (data) => this.employees = data,
    error: (err) => console.error(err)
  });
}




// Méthode pour récupérer le nom
getEmployeeName(employeeId: string): string {
  const employee = this.employees.find(e => e.id === employeeId);
  return employee ? employee.name : 'Employé inconnu';
}



  loadPresences(): void {
    this.presenceService.getAllPresences().subscribe({
        next: (data) => {
            this.presences = data;
            console.log('Présences chargées:', data); // Pour debug
        },
        error: (err) => console.error('Erreur de chargement des présences', err)
    });
}

  onEdit(presence: Presence): void {

  }

  onDelete(id: string): void {
    this.presenceService.deletePresence(id).subscribe({
      next: () => this.loadPresences(),
      error: (err) => console.error('Erreur suppression présence', err)
    });
  }


}


<app-admin-sidebar></app-admin-sidebar>

<main class="main-wrapper">
  <div class="container-fluid">
    <div class="inner-contents">
      <div class="page-header d-flex align-items-center justify-content-between mr-bottom-30">
        <button class="btn btn-success mb-3" [routerLink]="['/admin/attendances/add']">Ajouter une présence</button>

        <div class="left-part">
          <h2 class="text-dark">Liste des Présences</h2>
          <p class="text-gray mb-0">Historique des présences des employés.</p>
        </div>
      </div>

      <div class="card border-0 p-5">
        <div class="card-header bg-transparent border-0 p-0 d-flex align-items-center justify-content-between gap-3">
          <h6 class="mb-0">Détails des Présences</h6>
        </div>

        <div class="card-body p-0 pt-4">
          <table class="table table-striped">
            <thead>
              <tr>
                <th>Employé</th>
                <th>Date</th>
                <th>Entrée</th>
                <th>Sortie</th>
                <th>Heures Travaillées</th>
                <th>Heures Supplémentaires</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              <tr *ngFor="let presence of presences">
                <td>
                  <small class="text-muted d-block">ID: {{ presence.employeeId || 'N/A' }}</small>
                  <div>{{ getEmployeeName(presence.employeeId) }}</div>
                </td>
                <td>{{ presence.date | date:'dd/MM/yyyy' }}</td>
                <td>
                  <span *ngIf="presence.checkInTime; else naBlock">
                    {{ presence.checkInTime  }}
                  </span>
                  <ng-template #naBlock>N/A</ng-template>
                </td>
                <td>
                  <span *ngIf="presence.checkOutTime; else naBlock">
                    {{ presence.checkOutTime}}
                  </span>
                  <ng-template #naBlock>N/A</ng-template>
                </td>
                <td>{{ presence.hoursWorked }}</td>
                <td>{{ presence.overtimeHours }}</td>
                <td>
                  <button class="btn btn-warning" (click)="onEdit(presence)">Modifier</button>

                  <button class="btn btn-danger" (click)="onDelete(presence.id!)">Supprimer</button>
                </td>
              </tr>
            </tbody>
          </table>
        </div>
      </div>
    </div>
  </div>
</main>
